import{_ as a,c as e,o as t,U as r}from"./chunks/framework.yt81ECGw.js";const q=JSON.parse('{"title":"人工智能的一些基本概念","description":"","frontmatter":{},"headers":[],"relativePath":"src/AI/index.md","filePath":"src/AI/index.md","lastUpdated":1707459983000}'),i={name:"src/AI/index.md"},o=r('<h1 id="人工智能的一些基本概念" tabindex="-1">人工智能的一些基本概念 <a class="header-anchor" href="#人工智能的一些基本概念" aria-label="Permalink to &quot;人工智能的一些基本概念&quot;">​</a></h1><h2 id="_1-机器学习-深度学习-强化学习的基本概念及关系" tabindex="-1">1. 机器学习/深度学习/强化学习的基本概念及关系： <a class="header-anchor" href="#_1-机器学习-深度学习-强化学习的基本概念及关系" aria-label="Permalink to &quot;1. 机器学习/深度学习/强化学习的基本概念及关系：&quot;">​</a></h2><h4 id="_1-机器学习-通过机器学习过程的具有无确定规则的定义功能的程序" tabindex="-1">(1) 机器学习：通过机器学习过程的具有无确定规则的定义功能的程序 <a class="header-anchor" href="#_1-机器学习-通过机器学习过程的具有无确定规则的定义功能的程序" aria-label="Permalink to &quot;(1) 机器学习：通过机器学习过程的具有无确定规则的定义功能的程序&quot;">​</a></h4><h4 id="_2-神经网络-在机器学习的算法基础上添加模拟人类神经网络的结构" tabindex="-1">(2) 神经网络：在机器学习的算法基础上添加模拟人类神经网络的结构 <a class="header-anchor" href="#_2-神经网络-在机器学习的算法基础上添加模拟人类神经网络的结构" aria-label="Permalink to &quot;(2) 神经网络：在机器学习的算法基础上添加模拟人类神经网络的结构&quot;">​</a></h4><h4 id="_3-强化学习-通过程序与外部环境的反馈做到基于反馈优化计算的功能" tabindex="-1">(3) 强化学习：通过程序与外部环境的反馈做到基于反馈优化计算的功能 <a class="header-anchor" href="#_3-强化学习-通过程序与外部环境的反馈做到基于反馈优化计算的功能" aria-label="Permalink to &quot;(3) 强化学习：通过程序与外部环境的反馈做到基于反馈优化计算的功能&quot;">​</a></h4><h2 id="_2-监督学习与无监督学习的基本概念" tabindex="-1">2. 监督学习与无监督学习的基本概念： <a class="header-anchor" href="#_2-监督学习与无监督学习的基本概念" aria-label="Permalink to &quot;2. 监督学习与无监督学习的基本概念：&quot;">​</a></h2><h4 id="_1-监督学习-数据集有标签-多用于分类、回归问题-如图像识别、垃圾邮件分类等" tabindex="-1">(1) 监督学习：数据集有标签，多用于分类、回归问题，如图像识别、垃圾邮件分类等 <a class="header-anchor" href="#_1-监督学习-数据集有标签-多用于分类、回归问题-如图像识别、垃圾邮件分类等" aria-label="Permalink to &quot;(1) 监督学习：数据集有标签，多用于分类、回归问题，如图像识别、垃圾邮件分类等&quot;">​</a></h4><h4 id="_2-无监督学习-数据集不带标签-多用于聚类、数据降维等-如预训练、入侵检测等" tabindex="-1">(2) 无监督学习：数据集不带标签，多用于聚类、数据降维等，如预训练、入侵检测等 <a class="header-anchor" href="#_2-无监督学习-数据集不带标签-多用于聚类、数据降维等-如预训练、入侵检测等" aria-label="Permalink to &quot;(2) 无监督学习：数据集不带标签，多用于聚类、数据降维等，如预训练、入侵检测等&quot;">​</a></h4><h2 id="_3-敌手模型" tabindex="-1">3. 敌手模型： <a class="header-anchor" href="#_3-敌手模型" aria-label="Permalink to &quot;3. 敌手模型：&quot;">​</a></h2><p>攻击者称为敌手，敌手模型可以从敌手目标、敌手知识、敌手能力、敌手策略4个维度刻画</p><h4 id="_1-敌手目标-分为破坏机器学习的机密性、完整性、可用性" tabindex="-1">(1) 敌手目标：分为破坏机器学习的机密性、完整性、可用性 <a class="header-anchor" href="#_1-敌手目标-分为破坏机器学习的机密性、完整性、可用性" aria-label="Permalink to &quot;(1) 敌手目标：分为破坏机器学习的机密性、完整性、可用性&quot;">​</a></h4><ul><li><p>机密性：包含用户隐私的敏感信息不被泄露</p></li><li><p>完整性：敌手诱导模型行为或者使模型在预测中输出指定分类标签</p></li><li><p>可用性：阻止用户获得模型正确的输出或者阻止获取模型本身的一些特性，使其在目标环境下不可信赖</p></li></ul><h4 id="_2-敌手知识-包括模型的训练数据及特征、模型结构及参数、决策函数、访问目标模型得到反馈信息等" tabindex="-1">(2) 敌手知识：包括模型的训练数据及特征、模型结构及参数、决策函数、访问目标模型得到反馈信息等 <a class="header-anchor" href="#_2-敌手知识-包括模型的训练数据及特征、模型结构及参数、决策函数、访问目标模型得到反馈信息等" aria-label="Permalink to &quot;(2) 敌手知识：包括模型的训练数据及特征、模型结构及参数、决策函数、访问目标模型得到反馈信息等&quot;">​</a></h4>',13),l=[o];function h(n,d,s,_,c,u){return t(),e("div",null,l)}const m=a(i,[["render",h]]);export{q as __pageData,m as default};
